RT @ChicagoSports: The Bears rallied with 3 TDs in the 4th quarter to defeat the Lions 27-23 — the 1st time the Bears rallied from down by 17 or more to win in the final 15 minutes since a 31-27 win over the Lions in 1998.

@BradBiggs' 10 thoughts on the Bears' Week 1 win.

